var axios = require('axios')
var Cookies = require('js-cookie')
export const ProfileOne = (user) => {
    return new Promise((resolve, reject) => {
        var config = {
            method: 'get',
            url: 'https://designmocha-dev.el.r.appspot.com/designer/portfolio',
            headers: {
                'Cookie': 'session=eyJhbGciOiJSUzI1NiIsImtpZCI6InRCME0yQSJ9..Y1obCDqB-p0acDiuyYtrJ4pm0kytfcfKprkU2rF14m2agiRnVeFTI0C_gttMKSjiEYHOAzEpTLfkcUJLG8DjTwBXW0Aan1apTkF9Z08vCpvZuhKtYHWtdkeofw00vn0WGfmfC5m-8F_KCSGPFb8JYzbxqMlDVzU1Q7dJz6e58RD8azBBlrnC3RW8IixUbPUy0lHCfBd3_cVi3uqtguP_zg_twT507RykEylExlmcv4Ztv-rQ9Fu2OeJRqlWVybS_cIMyuF61m18EG39IUepDou81JaP3ti7EMgzH455-waBsj7MrAszCog1zUzG2Xyx6NgyukaG8JQanwsU5Ch43QQ; userProfile=true'
            }
        };
        axios(config)
            .then(function (response) {
                console.log(JSON.stringify(response.data));
            })
            .catch(function (error) {
                console.log(error);
            });
    })
}
